import React from "react";
import * as d3 from "d3";
import {select} from "d3/d3-selection";

export function Map()
{
	return (
		<div className={"map-container"}>
			<svg style={{
				height: 500,
				width: "100%",
				marginRight: "0px",
				marginLeft: "0px",
			}}>
				<g className={"plot-area"} />
				<g className={"x-axis"} />
				<g className={"y-axis"} />
			</svg>
		</div>
	);
}
